package com.revature.coding_challenges;

import org.junit.Assert;
import org.junit.Test;

public class Problem1Test {
    Problem1 sut = new Problem1();

    @Test
    public void test1() {
        Assert.assertTrue(sut.isSwap("ab", "ba"));
    }

    @Test
    public void test2() {
        Assert.assertFalse(sut.isSwap("ab", "ab"));
    }

    @Test
    public void test3() {
        Assert.assertTrue(sut.isSwap("aa", "aa"));
    }

    @Test
    public void test4() {
        Assert.assertTrue(sut.isSwap("abab", "abab"));
    }

    @Test
    public void test5() {
        Assert.assertTrue(sut.isSwap("aaaaaaabc", "aaaaaaacb"));
    }

    @Test
    public void test6() {
        Assert.assertFalse(sut.isSwap("ab", "ca"));
    }

    @Test
    public void test7() {
        Assert.assertFalse(sut.isSwap("abcd", "abcde"));
    }

    @Test
    public void test8() {
        Assert.assertTrue(sut.isSwap("", ""));
    }
}